import logo from './logo.svg';
import './App.css';
import Home from './components/pages/Home'
import Addnew from './components/student/AddNew';
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from './react-router-dom';

function App() {
  return (
    <div className="App">
      <h1>This is React App.....</h1>
      <BrowserRouter>
      <Link to='./components/pages/Home'>Home</Link>
      <Link to='./components/student/AddNew'>Add New</Link>
      <Routes>
        <Route exact path='./components/pages/Home' element={<Home/>}></Route>
        <Route exact path='./components/student/AddNew'element={<Addnew/>}></Route>
      </Routes>
      </BrowserRouter>

      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
